import styled, { css } from "styled-components";

export const NavigationContainer = styled.div`
    background-color: #292826;
    height: 80px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 1.2rem;
    position: sticky;

    .navigation-logo-container {
        cursor: pointer;
        height: 250px;
        width: 250px;
    }
`;

export const NavContainer = styled.div
